import React, { useEffect, useState } from 'react';

const SentimentAnalysis = () => {
  const [sentiments, setSentiments] = useState([]);

  const defaultSentimentData = [
    -0.5, -0.3, -0.7, -0.8, -0.6, -0.4, -0.9, -1, -0.5, -0.2, // Negative sentiment data
  ];

  useEffect(() => {
    const sentimentData = (entries && entries.length > 0)
      ? entries.map(() => Math.random() * -1) // Random negative sentiment values
      : defaultSentimentData; // Use default negative sentiment if no entries
    setSentiments(sentimentData);
  }, []);

  return (
    <div>
      <h1>Sentiment Analysis</h1>
      <div>
        {sentiments.map((sentiment, index) => (
          <p key={index}>Sentiment {index + 1}: {sentiment.toFixed(2)}</p>
        ))}
      </div>
    </div>
  );
};

export default SentimentAnalysis;
